import React, { useEffect, useState } from "react";
const url = "http://localhost:8000/rides"

const Operations = () => {

    const [rides, setRides] = useState([]);

    const getRides = async () => {
        const response = await fetch(url);
        const json = await response.json();
        setRides(json);
    }

    useEffect(() => {
        getRides();
    }, []);

    console.log(rides);
    return (
        <>
            <h1>Hello</h1>
